import React from "react";
import img from "../assets/book_sample.jpeg";
import "./SellUsedPage.scss";

const SellUsedPage = () => {
  return (
      <div className="upload__card__wrapper">
        <img src={img} className="upload__card__img"></img>
        <p>BookName</p>
        <p>Authorname</p>
        <p>Price</p>
        <button>Add to cart</button>
      </div>
  );
};

export default SellUsedPage;
